function DesText() {
  return (
    <p>
      Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce volutpat at
      eros et sagittis. Etiam quis arcu condimentum, dapibus enim non, maximus
      dui. Phasellus non hendrerit velit.
    </p>
  );
}

export default DesText;
